# Hàm kiểm tra nếu biến tồn tại và không rỗng, nếu không trả về giá trị mặc định
def get_max_score_or_default(var_name, default=100):
    try:
        # Kiểm tra nếu biến đã được định nghĩa
        if var_name in globals() and globals()[var_name]:
            return max(globals()[var_name])  # Lấy giá trị lớn nhất nếu biến tồn tại và không rỗng
        else:
            return default  # Giá trị mặc định nếu biến rỗng
    except NameError:
        return default  # Giá trị mặc định nếu biến chưa tồn tại

# Điểm tối đa (reward_score) cho mỗi thuật toán
reward_score = {
    1: get_max_score_or_default("dqn_reward_scores"),  # Deep Q-Learning
    2: get_max_score_or_default("dr_reward_scores"),   # Deep Reinforce
    3: get_max_score_or_default("ql_reward_scores"),   # Q-Learning
    4: get_max_score_or_default("mc_reward_scores"),   # Monte Carlo
}

# Lấy điểm tối đa từ reward_score cho thuật toán được chọn
agent_score = reward_score.get(picked_algorithm, 100)  # Mặc định là 100 nếu thuật toán không tồn tại
z.z.angularBind("agent_score", agent_score)

# In ra điểm khởi tạo
print(f"Điểm khởi tạo của agent (thuật toán {picked_algorithm}): {agent_score}")

