        border: 1px solid #ccc;
        border-radius: 8px;
        padding: 15px;
        width: 200px;
        box-shadow: 0px 4px 6px rgba(0, 0, 0, 0.1);
        background-color: #f9f9f9;
        text-align: center;
        position: relative;
        transition: transform 0.2s, box-shadow 0.2s;
    }
    .product:hover {
        transform: translateY(-5px);
        box-shadow: 0px 6px 10px rgba(0, 0, 0, 0.2);
    }
    .product img {
        max-width: 100%;
        height: auto;
        border-radius: 4px;
        margin-bottom: 10px;
    }
    .product h4 {
        font-size: 16px;
        color: #333;
        margin-bottom: 10px;
    }
    .product p {
        font-size: 14px;
        color: #666;
        margin-bottom: 5px;
    }
    .product button {
        padding: 8px 12px;
        font-size: 14px;
        color: white;
        background-color: #007bff;
        border: none;
        border-radius: 4px;
        cursor: pointer;
        transition: background-color 0.3s;
    }
    .product button:hover {
        background-color: #0056b3;
    }
</style>

<script type="text/javascript">

    window.selectProduct = function(o) {
        let asin = o.getAttribute('value'); // Lấy giá trị ASIN
        console.log("Selected ASIN: ", asin);
    
        let element = document.getElementById('container 1');
        let scope = angular.element(element).scope(); // Lấy Angular scope
    
        // Đồng bộ giá trị vào scope và gọi z.z.angularBind
        scope.$apply(() => {
            scope.selectedProduct = asin;
            scope.z.angularBind('selectedProduct', asin, '20241117-182350_1363104631');// Cập nhật z.z.angular
        });
    
        console.log("Angular Scope Updated: ", scope.selectedProduct);
    
        // Gọi paragraph xử lý Python
        scope.z.runParagraph('20241117-182350_1363104631');
    };

    window.refreshProducts = function() {
        let element = document.getElementById('container 1');
        let scope = angular.element(element.parentNode).scope().compiledScope;
        scope.z.runParagraph('20241117-182326_1141736416');
    };
</script>

<div id="container 1" ondblclick="event.stopPropagation()" class="container 1">
    <div class="agent-info">
        <h3>Điểm hiện tại của agent: {{agent_score}}</h3>
        <button onclick="window.refreshProducts()">Làm mới danh sách</button>
    </div>

    <div ng-if="products_info && products_info.length > 0" class="products-grid">
        <div ng-repeat="product in products_info" class="product">
            <img src="{{global_image_data}}" alt="Product Image" />
            <h4>{{product.asin}}</h4>
            <h5>{{product.title}}</h5>
            <p>Previous review: {{product.summary}}</p>
            <p>Rating: {{product.rating}}</p>
            <button ng-value="product.asin" onclick="window.selectProduct(this)">Chọn sản phẩm</button>
        </div>
    </div>

    <div ng-if="!products_info || products_info.length === 0">
        <p>Không có sản phẩm để hiển thị.</p>
    </div>
</div>
